    "82df3865-cf97-4e9a-9377-3b34f44774ee": {"id":"82df3865-cf97-4e9a-9377-3b34f44774ee","project_id":10496,"key":24888684,"version":null,"meta":{"subType":"HotSpotIsolated"},"children":[{"id":"fd5303ce-b294-47cd-bda8-f6f294c2f041","type":"Ref"},{"id":"4ff275c5-99d1-459a-b4e8-2111c5e4fb73","type":"Ref"},{"id":"c4ceb927-96d3-4b1b-94e1-3c3afdd63128","type":"Ref"},{"id":"57c25b0f-5402-41af-a80d-1b329e69b5e6","type":"Ref"}],"deleted_at":null,"created_at":"2022-04-06T02:57:07.579Z","updated_at":"2022-04-06T02:57:07.579Z","props":{"numberOfAttempts":1,"lockDown":0,"score":false,"hotspotType":"circle","src":"images/image_1065672.png","imageId":1065672,"imgWidth":3542,"imgHeight":2084,"hotSpotColor":"#f1eaff","hotSpotSize":85,"showSeenState":1,"useMediaInFeedback":false},"type":"HotSpotIsolated"}, 
    "323f09f9-4220-4a86-b196-fafb7b0a436d": {"id":"323f09f9-4220-4a86-b196-fafb7b0a436d","project_id":10496,"key":24888544,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-04-06T02:53:02.602Z","updated_at":"2022-04-06T02:53:02.602Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003ch4 data-type=\"heading-four\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eSet an environment of no hesitation\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eEncourage your team to get in touch with you regularly, and don\u0026#x27;t forget to reach out to them too! \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003c/h4\u003e\u003cp data-type=\"paragraph\"\u003e\u003cem data-type=\"italic\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eIt\u0026#x27;s quite amazing how a simple \u0026quot;Hey! Howya goin over there?\u0026quot; out of the blue, can be received in such a positive way.\u003c/span\u003e\u003c/em\u003e\u003c/p\u003e\u003c/div\u003e","bulletColor":"#3a0e7c"},"type":"Text"}, 
    "7bc885e1-39cc-46c6-ba22-d5b3e93bb480": {"id":"7bc885e1-39cc-46c6-ba22-d5b3e93bb480","project_id":10496,"key":24888530,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-04-06T02:52:35.150Z","updated_at":"2022-04-06T02:52:35.150Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003ch4 data-type=\"heading-four\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eFind ways to ensure everyone gets a word in\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eBe inclusive, try and get everyone involved in discussions. Some individuals don\u0026#x27;t tend to naturally talk in a video chat.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003c/h4\u003e\u003cp data-type=\"paragraph\"\u003e\u003cem data-type=\"italic\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eAn example is you can start each stand-up in a video call and have the \u0026quot;raise hand\u0026quot; emoji checked until you have gone. It\u0026#x27;s surprising how often a team forgets a certain someone hasn\u0026#x27;t been yet.\u003c/span\u003e\u003c/em\u003e\u003c/p\u003e\u003c/div\u003e","bulletColor":"#3a0e7c"},"type":"Text"}, 
    "bb3f3d06-6f3e-4224-97a6-23e2217f4e62": {"id":"bb3f3d06-6f3e-4224-97a6-23e2217f4e62","project_id":10496,"key":24888521,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-04-06T02:52:20.904Z","updated_at":"2022-04-06T02:52:20.904Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003ch4 data-type=\"heading-four\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003e Sharing calendars and communicating when you\u0026#x27;re away\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eWhen possible, share an up to date team calendar on a platform visible to everyone. Making use of \u0026quot;away\u0026quot; or \u0026quot;out of office\u0026quot; status\u0026#x27; can reduce communication breakdowns!\u003c/span\u003e\u003c/p\u003e\u003c/h4\u003e\u003c/div\u003e","bulletColor":"#3a0e7c"},"type":"Text"}, 
    "570911d2-a3e9-4bec-a62a-6c6c795d7f0f": {"id":"570911d2-a3e9-4bec-a62a-6c6c795d7f0f","project_id":10496,"key":24888469,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-04-06T02:51:44.820Z","updated_at":"2022-04-06T02:51:44.820Z","props":{"useBackgroundControls":true,"borderRadius":0,"content":"\u003ch3 data-type=\"heading-three\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eDistractions\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/h3\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eThey\u0026#x27;re part of life - and there\u0026#x27;s more of them at home! Whether it\u0026#x27;s the dog perfectly timing a big old chat with the neighbours doggo during a video call, or those noisy construction workers outside going to town of the jack hammer.\u003c/span\u003e\u003c/p\u003e","bulletColor":"#3a0e7c"},"type":"Text"}, 
    "b792c756-b06c-4dfb-8641-ca1bb0ed8152": {"id":"b792c756-b06c-4dfb-8641-ca1bb0ed8152","project_id":10496,"key":24888458,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-04-06T02:51:33.966Z","updated_at":"2022-04-06T02:51:33.966Z","props":{"useBackgroundControls":true,"borderRadius":0,"content":"\u003ch3 data-type=\"heading-three\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eCommunication is harder\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h3\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eYou can\u0026#x27;t simply walk down the hall to ask your team mate a question when working remotely. Instead you \u0026quot;fire off an email\u0026quot;. This opens up many pro\u0026#x27;s and con\u0026#x27;s of course. And as a leader it\u0026#x27;s good to be aware of them.\u003c/span\u003e\u003c/p\u003e","bulletColor":"#3a0e7c"},"type":"Text"}, 
    "47ac5b23-9b70-462d-b89e-a5750b584fce": {"id":"47ac5b23-9b70-462d-b89e-a5750b584fce","project_id":10496,"key":24888446,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-04-06T02:51:18.164Z","updated_at":"2022-04-06T02:51:18.164Z","props":{"useBackgroundControls":true,"borderRadius":0,"content":"\u003ch3 data-type=\"heading-three\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eLack of face-to-face Contact \u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h3\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eWe are social creatures! For many, being at the office made up a big chunk of their social life. So remote work can increase isolation for some. Resulting in a shift of behaviour.\u003c/p\u003e","bulletColor":"#3a0e7c"},"type":"Text"}, 
