    "71f87dc5-253e-4fa1-bb56-3bf0a5d4cf4f": {"id":"71f87dc5-253e-4fa1-bb56-3bf0a5d4cf4f","project_id":10496,"key":24759739,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-04-04T05:59:53.417Z","updated_at":"2022-04-04T05:59:53.417Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003ch4 data-type=\"heading-four\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eConsistent stand-ups and task communication\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eEveryone in the team can share a daily task-list in 2 minutes, briefly outlining what they\u0026#x27;re working on \u0026amp; share any deadlines or concerns\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003c/h4\u003e\u003cp data-type=\"paragraph\"\u003e\u003cem data-type=\"italic\"\u003e\u003cspan class=\"css-1cimcjb-rules\" style=\"color:#3a0e7c\" data-type=\"color\"\u003eYou may have different sprint planning dates and times of course - but consistency is key\u003c/span\u003e\u003c/em\u003e\u003c/p\u003e\u003c/div\u003e","bulletColor":"#3a0e7c"},"type":"Text"}, 
