    "2f8f579d-3ae5-4fae-9dcf-013fb721fd4a": {"id":"2f8f579d-3ae5-4fae-9dcf-013fb721fd4a","project_id":10496,"key":28423007,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2022-05-31T03:52:32.791Z","updated_at":"2022-05-31T03:52:32.791Z","props":{"useBackgroundControls":true,"borderRadius":0,"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-1gp87jq-rules\" style=\"color:#f1eaff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWelcome to the Leading Remote Teams module \u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-19gxu96-rules\" style=\"color:#ffffff\" data-type=\"color\"\u003eWorking remotely is one thing, but \u003c/span\u003e\u003cspan class=\"css-19gxu96-rules\" style=\"color:#ffffff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eleading a remote team\u003c/strong\u003e\u003c/span\u003e\u003cspan class=\"css-19gxu96-rules\" style=\"color:#ffffff\" data-type=\"color\"\u003e is another! \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-19gxu96-rules\" style=\"color:#ffffff\" data-type=\"color\"\u003eSince the vid\u0026#x27; landed, has your email inbox become heavily backlogged? Online video-meetings increased drastically? Slack/teams conversations went from jovial discussions to courageous conversations?\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-19gxu96-rules\" style=\"color:#ffffff\" data-type=\"color\"\u003eThis bite sized module will only take 5 minutes and is designed to give you some useful tips on how to lead from afar! \u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
